@jared, I want to work with you because you have lots of technical knowledge, have a 9 am stand up, lots of shortcuts and prove that you can have fun and still be an awesome developer. 

I want to work with you more, period. In terms of feedback you wanted on how to help peeps avoid conflict or something, maybe you could drop by teams from time to time to check in on how they are doing and seeing if they could use some help. 


I personally prefer a more written format of instructions over lots of verbal instructions, I would like to ask you to please provide more written instructions on how to get unblocked that would be great. I am sorry I wasn't able to give this feedback to you prior, it just came as a thought currently.
